-- ----------------------------
--  Table structure for `positionLog`
-- ----------------------------
DROP TABLE IF EXISTS `positionLog`;
CREATE TABLE `positionLog` (
  `id` char(36) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL,
  `name` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `seqNo` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `year` int(11) NOT NULL,
  `wasStaffName` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `skillLevel` enum('High','Middle','Low') COLLATE utf8_unicode_ci NOT NULL,
  `location` enum('Local','Expat','Common') COLLATE utf8_unicode_ci NOT NULL,
  `entryDate` datetime DEFAULT NULL,
  `leaveDate` datetime DEFAULT NULL,
  `sowLevel` enum('level1','level2','level3','level4','level5') COLLATE utf8_unicode_ci NOT NULL,
  `flowStatus` enum('Open','Recruiting','Closed','TransferringIn','TransferredIn','TransferringOut','TransferredOut','Leaving','Left') COLLATE utf8_unicode_ci NOT NULL,
  `status` int(11) DEFAULT '1',
  `remark` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `createdAt` datetime NOT NULL,
  `updatedAt` datetime NOT NULL,
  `positionId` char(36) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL,
  `staffId` char(36) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL,
  `titleId` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `companyId` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `fordFunctionId` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `officeId` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `currencyId` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `teamId` char(36) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL,
  `stdPosId` char(36) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL,
  `stdPosDetailId` char(36) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL,
  `createdUsr` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `updatedUsr` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `positionId` (`positionId`),
  KEY `staffId` (`staffId`),
  KEY `titleId` (`titleId`),
  KEY `companyId` (`companyId`),
  KEY `fordFunctionId` (`fordFunctionId`),
  KEY `officeId` (`officeId`),
  KEY `currencyId` (`currencyId`),
  KEY `teamId` (`teamId`),
  KEY `stdPosId` (`stdPosId`),
  KEY `stdPosDetailId` (`stdPosDetailId`),
  KEY `createdUsr` (`createdUsr`),
  KEY `updatedUsr` (`updatedUsr`),
  KEY `position_log_status` (`status`) USING BTREE,
  CONSTRAINT `positionlog_ibfk_1` FOREIGN KEY (`positionId`) REFERENCES `position` (`id`) ON DELETE NO ACTION ON UPDATE CASCADE,
  CONSTRAINT `positionlog_ibfk_10` FOREIGN KEY (`stdPosDetailId`) REFERENCES `stdPosDetail` (`id`) ON DELETE NO ACTION ON UPDATE CASCADE,
  CONSTRAINT `positionlog_ibfk_11` FOREIGN KEY (`createdUsr`) REFERENCES `account` (`id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `positionlog_ibfk_12` FOREIGN KEY (`updatedUsr`) REFERENCES `account` (`id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `positionlog_ibfk_2` FOREIGN KEY (`staffId`) REFERENCES `staff` (`id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `positionlog_ibfk_3` FOREIGN KEY (`titleId`) REFERENCES `title` (`id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `positionlog_ibfk_4` FOREIGN KEY (`companyId`) REFERENCES `company` (`id`) ON DELETE NO ACTION ON UPDATE CASCADE,
  CONSTRAINT `positionlog_ibfk_5` FOREIGN KEY (`fordFunctionId`) REFERENCES `fordFunction` (`id`) ON DELETE NO ACTION ON UPDATE CASCADE,
  CONSTRAINT `positionlog_ibfk_6` FOREIGN KEY (`officeId`) REFERENCES `office` (`id`) ON DELETE NO ACTION ON UPDATE CASCADE,
  CONSTRAINT `positionlog_ibfk_7` FOREIGN KEY (`currencyId`) REFERENCES `currency` (`id`) ON DELETE NO ACTION ON UPDATE CASCADE,
  CONSTRAINT `positionlog_ibfk_8` FOREIGN KEY (`teamId`) REFERENCES `team` (`id`) ON DELETE NO ACTION ON UPDATE CASCADE,
  CONSTRAINT `positionlog_ibfk_9` FOREIGN KEY (`stdPosId`) REFERENCES `stdPos` (`id`) ON DELETE NO ACTION ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

