DROP TABLE IF EXISTS `staff`;
CREATE TABLE `staff` (
  `id` char(36) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL,
  `name` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `gender` enum('Male','Female') COLLATE utf8_unicode_ci DEFAULT NULL,
  `location` enum('Local','Expat','Common') COLLATE utf8_unicode_ci DEFAULT NULL,
  `skillLevel` enum('High','Middle','Low') COLLATE utf8_unicode_ci DEFAULT NULL,
  `staffType` enum('Regular','Freelancer') COLLATE utf8_unicode_ci NOT NULL,
  `flowStatus` enum('Onboarded','Transferring','Leaving','Left','Extending') COLLATE utf8_unicode_ci NOT NULL,
  `status` int(11) DEFAULT '1',
  `remark` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `createdAt` datetime NOT NULL,
  `updatedAt` datetime NOT NULL,
  `companyId` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `currencyId` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `officeId` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `teamId` char(36) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL,
  `titleId` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `stdPosId` char(36) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL,
  `stdPosDetailId` char(36) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL,
  `createdUsr` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `updatedUsr` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `name` (`name`),
  UNIQUE KEY `staff_name_unique` (`name`),
  KEY `companyId` (`companyId`),
  KEY `currencyId` (`currencyId`),
  KEY `officeId` (`officeId`),
  KEY `teamId` (`teamId`),
  KEY `titleId` (`titleId`),
  KEY `stdPosId` (`stdPosId`),
  KEY `stdPosDetailId` (`stdPosDetailId`),
  KEY `createdUsr` (`createdUsr`),
  KEY `updatedUsr` (`updatedUsr`),
  KEY `staff_name` (`name`) USING BTREE,
  KEY `staff_location` (`location`) USING BTREE,
  KEY `staff_staff_type` (`staffType`) USING BTREE,
  KEY `staff_status` (`status`) USING BTREE,
  CONSTRAINT `staff_ibfk_1` FOREIGN KEY (`companyId`) REFERENCES `company` (`id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `staff_ibfk_2` FOREIGN KEY (`currencyId`) REFERENCES `currency` (`id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `staff_ibfk_3` FOREIGN KEY (`officeId`) REFERENCES `office` (`id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `staff_ibfk_4` FOREIGN KEY (`teamId`) REFERENCES `team` (`id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `staff_ibfk_5` FOREIGN KEY (`titleId`) REFERENCES `title` (`id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `staff_ibfk_6` FOREIGN KEY (`stdPosId`) REFERENCES `stdPos` (`id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `staff_ibfk_7` FOREIGN KEY (`stdPosDetailId`) REFERENCES `stdPosDetail` (`id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `staff_ibfk_8` FOREIGN KEY (`createdUsr`) REFERENCES `account` (`id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `staff_ibfk_9` FOREIGN KEY (`updatedUsr`) REFERENCES `account` (`id`) ON DELETE SET NULL ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

