  `leaveDate` datetime DEFAULT NULL,
  `stopPayDate` datetime DEFAULT NULL,
  `increaseCycle` int(11) DEFAULT NULL,
  `nextIncreaseMonth` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `noticePeriod` decimal(6,2) DEFAULT NULL,
  `status` int(11) DEFAULT '1',
  `remark` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `createdAt` datetime NOT NULL,
  `updatedAt` datetime NOT NULL,
  `staffId` char(36) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL,
  `createdUsr` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `updatedUsr` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `staffId` (`staffId`),
  KEY `createdUsr` (`createdUsr`),
  KEY `updatedUsr` (`updatedUsr`),
  KEY `staff_history_status` (`status`) USING BTREE,
  CONSTRAINT `staffhistory_ibfk_1` FOREIGN KEY (`staffId`) REFERENCES `staff` (`id`) ON DELETE NO ACTION ON UPDATE CASCADE,
  CONSTRAINT `staffhistory_ibfk_2` FOREIGN KEY (`createdUsr`) REFERENCES `account` (`id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `staffhistory_ibfk_3` FOREIGN KEY (`updatedUsr`) REFERENCES `account` (`id`) ON DELETE SET NULL ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

